/****** Object:  View [Data].[AnnualPlan]    Script Date: 21/11/2023 5:11:49 p. m. ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [Data].[AnnualPlan]
AS
select 
	a.Year, 
	a.Month1 'Month1', a.Month2 'Month2', a.Month3 'Month3', 
	b.Month1 'Month4', b.Month2 'Month5', b.Month3 'Month6', 
	c.Month1 'Month7', c.Month2 'Month8', c.Month3 'Month9', 
	d.Month1 'Month10', d.Month2 'Month11', d.Month3 'Month12'
from 
	Data.Forecast a
	JOIN Data.Forecast b ON a.Year = b.Year AND b.Quarter = 2
	JOIN Data.Forecast c ON a.Year = c.Year AND c.Quarter = 3
	JOIN Data.Forecast d ON a.Year = d.Year AND d.Quarter = 4
where
	a.Quarter = 1
GO
