CREATE TRIGGER [Data].[UpdateForecast] 
   ON  [Data].[Forecast]
   AFTER UPDATE
AS 
BEGIN

	DECLARE @ForecastYear INT,
			@ForecastQuarter INT,
			@Month1 FLOAT,
			@Month2 FLOAT,
			@Month3 FLOAT

	SELECT 
		@ForecastYear = [Year], 
		@ForecastQuarter = [Quarter],
		@Month1 = [Month1],
		@Month2 = [Month2],
		@Month3 = [Month3]
	FROM 
		inserted;

	IF (@ForecastQuarter = 4)
		UPDATE 
			Data.Forecast 
		SET 
			Month1 = @Month1, Month2 = @Month2, Month3 = @Month3
		WHERE
			[Year] = @ForecastYear AND [Quarter] IN (1,2,3)

	IF (@ForecastQuarter = 3)
		UPDATE 
			Data.Forecast 
		SET 
			Month1 = @Month1, Month2 = @Month2, Month3 = @Month3
		WHERE
			[Year] = @ForecastYear AND [Quarter] IN (1,2)

	IF (@ForecastQuarter = 2)
		UPDATE 
			Data.Forecast 
		SET 
			Month1 = @Month1, Month2 = @Month2, Month3 = @Month3
		WHERE
			[Year] = @ForecastYear AND [Quarter] IN (1)


END
GO
ALTER TABLE [Data].[Forecast] ENABLE TRIGGER [UpdateForecast]
GO

CREATE VIEW Data.CostsVSRevenues
AS
SELECT a.FK_LineOfBusiness, a.Year, a.Month, a.Cost, b.Revenue FROM
(
SELECT b.FK_LineOfBusiness, a.Year, a.Month, SUM(Value) Cost
FROM Data.FinalCosts a
INNER JOIN Data.ExpenseItem b ON a.FK_ExpenseItem = b.PK_ExpenseItem
GROUP BY b.FK_LineOfBusiness, a.Year, a.Month
) a 
JOIN 
(
SELECT a.FK_LineOfBusiness, a.Year, a.Month, SUM(Value) Revenue
FROM Data.FinalRevenues a
GROUP BY a.FK_LineOfBusiness, a.Year, a.Month
) b ON a.FK_LineOfBusiness = b.FK_LineOfBusiness AND a.Year = b.Year AND a.Month = b.Month